Code-Along: Personal Quiz
Follow this guide to create and customize an interactive quiz. These instructions use Ash Ketchum as an example subject, but make sure to change the questions and answers to be about you!
Part 1 - Setup
Start by forking the existing project. It contains all of the HTML and CSS, but none of the JavaScript.

Note: You must be logged into Replit to fork the project


Click here to open the starter project
Click the "Fork Repl" button in the upper right
Click the "Fork Repl" button in the pop-up that appears
Run the project to see how it looks!

Everything should show up on the page, but the button will not be functional yet...
Part 2 - Hooking Up the Button
There is currently no JavaScript code, so nothing happens when the button is clicked! Take a look at the  element in the HTML:
Start the Quiz

The onclick attribute is trying to call a function named startQuiz - you have to define it!

Open the script.js file for editing
At the top, define a function named startQuiz
function keyword
Function name (startQuiz)
Parentheses (())
Curly brackets ({})


Make a new line in the body of the function
Between the curly brackets


There, add an alert statement that says "Loading..."
Run the project again, click the button, and verify that a pop-up appears!

The code in the script.js file should look something like this:
function startQuiz() {
  alert("Loading...");
}

Part 3 - Adding a Personal Greeting
The button is working, but it's not doing anything too exciting yet. Welcome the user to the quiz with a personalized message using the name they entered in the text input!

Make a new line in the body of the startQuiz function
There, create a new variable named nameInput
Set the nameInput value to get the  element from the HTML
Use document.querySelector to accomplish this


Under that, create a new variable named name
Set the name value to get the actual text from the nameInput element
Use .value to accomplish this


Under that, add an alert that says "Hello, NAME! Get ready for some questions..."
Make the message into a template string, and replace "NAME" with ${name} to use the text from the box
Run the project again, enter a name in the text box, click the button, and verify that the greeting is personalized!

The additional code within the body of the startQuiz function should look something like this:
let nameInput = document.querySelector("#name");
let name = nameInput.value;

alert(`Hello, ${name}! Get ready for some questions...`);

Part 4 - Preparing the Score
Now it's time to get into the quiz! Start by setting up some storage variables to keep track of the player's score.

Make a new line in the body of the startQuiz function
There, create a new variable named score
Set the score value to 0 to start
Under that, create a new variable named numQuestions
Set the numQuestions value to 3.0 for now
The .0 is for calculation purposes



Note that nothing will actually change when clicking the button again - these variables will be used a bit later. The additional code within the body of the startQuiz function should look something like this:
let score = 0;
let numQuestions = 3.0;

Part 5 - Asking One Question
Now that the variables are initialized, this quiz needs some questions! Start with this one:



Question
Answer




What is my name?
Ash Ketchum




Make a new line at the bottom of the startQuiz function
There, create a variable named answer1
Set answer1 to the result of a prompt asking "What is my name?"
Under that, create an if statement
if keyword
Parentheses (())
Curly brackets ({})


For the condition (between parentheses), check if answer1 is equal to "Ash Ketchum"
Use === to compare the two


In the body of the if (between curly brackets), make a new line
There, set score to be score + 1
This increases the score by 1!


Click the button, and verify that the new prompt appears!

The additional code within the body of the startQuiz function should look something like this:
let answer1 = prompt("What is my name?");
if (answer1 === "Ash Ketchum") {
  score = score + 1;
}

Part 6 - Asking More Questions
Additional questions will use almost exactly the same code as the first question. The only things that will change are:

The answer variable name (e.g., answer2 instead of answer1)
The question text (e.g., "Where do I live?" instead of "What is my name?")

Other than that, you can follow the steps from Part 5 to add each additional question! Add at least two more:



Question
Answer




Where do I live?
Kanto


What is my cat's name?
Pikachu




Note: If there are more or less than three questions, the value of the numQuestions variable will need to change

The code for the additional questions should look something like this:
let answer2 = prompt("Where do I live?");
if (answer2 === "Kanto") {
  score = score + 1;
}

let answer3 = prompt("What is my cat's name?");
if (answer3 === "Pikachu") {
  score = score + 1;
}

Now the quiz is complete, but the player has no idea if they got the questions right or wrong!
Part 7 - Calculating and Displaying the Result
At this point, the startQuiz function knows the number of correct answers (stored in the score variable), so the final result can be calculated. There will be a little math involved, and then the player will get a nice message saying whether they passed or failed.

Make a new line at the bottom of the startQuiz function
There, add an alert that says "Calculating..."
Under that, create a variable named scorePercent
Set the scorePercent variable to be 100 times score divided by numQuestions
This is their final percentage based on how many they got right


Under that, create an if/else structure
if keyword
Parentheses
Curly brackets
else keyword
More curly brackets


For the condition (between parentheses), check if scorePercent is greater than 60
In the body of the if, use an alert to say "You passed 😎"
In the body of the else, use an alert to say "You failed 😭"
Run the project, take the quiz, and make sure the calculation is correct!

The additional code within the body of the startQuiz function should look something like this:
